    false,nt"url": null,nt"notes": " In New England (Connecticut, Maine, Massachusetts,
    New Hampshire, Rhode Island, and Vermont), the Office of Management and Budgetn
                  (OMB) has defined an alternative county subdivision (generally cities
    and towns) based definition of Core Based Statistical Areas (CBSAs) known asn               New
    England City and Town Areas (NECTAs). NECTAs are defined using the same criteria
    as Metropolitan Statistical Areas and Micropolitan Statistical Areasn               and
    are identified as either metropolitan or micropolitan, based, respectively, on the
    presence of either an urban area of 50,000 or more population orn               an
    urban cluster of at least 10,000 and less than 50,000 population. A NECTA containing
    a single core urban area with a population of at least 2.5n               million
    may be subdivided to form smaller groupings of cities and towns referred to as NECTA
    Divisions. The NECTAs for the 2010 Census are those definedn               by OMB
    and published in 2013. ",nt"license_title": null,nt"extras": [{ntt"key":
